import React from 'react';

const ResultsContainer = ({ SuggestedNames }) => {
    const SuggestedNamesJsx = SuggestedNames.map((SuggestedName) => {
        return (<p> {SuggestedName}</p>);
    });

    return (
        <div>
            <p>
                {SuggestedNamesJsx}
            </p>
        </div>
    );
};

export default ResultsContainer;
